/*
	Get singleton instance
*/
CGlobalData& CGlobalData::Instance()
{
	static CGlobalData ms_Instance;

	return ms_Instance;
}

/*
	Update major offsets (Object manager, Interact base)
*/
void CGlobalData::RefreshOffsets()
{
	CMemCore::Instance().Read(CMemCore::Instance().Read<DWORD>(OBJECT_MGR_BASE), sizeof(ObMan), &ObjMgr);

	InitAttribs();
}

/*
	Hash string in lower case
	Used in Game balance

	IN:
		str - string to hash

	OUT:
		void

	RETURN:
		Error code

*/
DWORD CGlobalData::HashStringLC( std::string str )
{
	DWORD hash = 0;

	std::transform(str.begin(), str.end(), str.begin(), ::tolower);

	for (size_t i = 0; i < str.length(); ++i)
		hash = (hash << 5) + hash + str[i];

	return hash;
}


/*
	DEBUG
	Search for DWORD value in structure

	IN:
		pData - start of data
		size - data size
		val - value to seek

	OUT:
		offsets - found offsets

	RETURN:
		Error code
			
*/
DWORD CGlobalData::SeekDWORD( DWORD* pData, int size, DWORD val, std::vector<DWORD> &offsets )
{
	DWORD dwBase = (DWORD)pData;

	if(pData && size > 0 && size % 4 == 0)
	{
		for(; (int)pData < (int)dwBase + size; pData++ )
			if(*pData && *pData == val)
				offsets.push_back((DWORD)pData - dwBase);

		return ERROR_SUCCESS;
	}
	else
		return ERROR_INVALID_PARAMETER;
}


